# Self-check
# Write two Python functions to find the minimum number in a list.
# The first function should compare each number to every other number on the list 0(n^2) .
# The second function should be linear O(n).
import time

def measuretime(func):
    def inner1(*args, **kwargs):
        start = time.time()
        res = func(*args, **kwargs)
        print("time elapsed: ", time.time() - start)
        return res
    return inner1

@measuretime
def minnumOn2(n):
    c = 0
    for i in n:
        for a in n:
            if a < i:
                c = a
    return c
# T(n)= 3 + n^2 = O(n^2)

@measuretime
def minnumOn(n):
    c = float('inf')
    for i in n:
        if c > i:
            c = i
    return c
# T(n) = 3 + n = O(2n) = O(n)

